import React from 'react';
import styles from './CopyButton.module.css';


const CopyButton = () => {
  return (
    <svg className={styles.copyButton} xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">
      <path className={styles.copyButtonPath1}/>
      <path className={styles.copyButtonPath2}/>
    </svg>
  )
}


export default CopyButton
